// DeleteUniqueIndexCache 删除索引存在的缓存
func (s *SysNotifyMessageRepo) DeleteIndexCache(ctx context.Context, data ...*ai_boilerplate_model.SysNotifyMessage) error {
	KeyMap := make(map[string]struct{})
	keys := make([]string, 0)
	keys = append(keys, s.cache.Key(CacheSysNotifyMessageByConditionPrefix))
	for _, item := range data {
		if item != nil {
			KeyMap[s.cache.Key(CacheSysNotifyMessageByIDPrefix, item.ID)] = struct{}{}
			KeyMap[s.cache.Key(CacheSysNotifyMessageByReceiverReadTimePrefix, item.Receiver, item.ReadTime)] = struct{}{}
			KeyMap[s.cache.Key(CacheSysNotifyMessageByReceiverPrefix, item.Receiver)] = struct{}{}
		}
	}
	for item := range KeyMap {
		keys = append(keys, item)
	}
	err := s.cache.DelBatch(ctx, keys)
	if err != nil {
		return err
	}
	return nil
}
